function TypingText({ text, speed, onDone }) {
  const [shown, setShown] = useState('');
  const [typing, setTyping] = useState(true);
  useEffect(() => {
    setTyping(true); let i = 0; setShown('');
    const iv = setInterval(() => { i++; setShown(text.slice(0,i)); if(i>=text.length){clearInterval(iv);setTyping(false);if(onDone)onDone();} }, speed||25);
    return () => clearInterval(iv);
  }, [text]);
  return <>{shown}{typing && <span style={{animation:'blink .7s infinite'}}>|</span>}</>;
}

function StarField() {
  const stars = useMemo(() => Array.from({length:60},(_,i)=>({
    left: Math.random()*100+'%', top: Math.random()*100+'%',
    animationDelay: Math.random()*3+'s', opacity: 0.3+Math.random()*0.7,
    width: 1+Math.random()*2+'px', height: 1+Math.random()*2+'px'
  })), []);
  return <div className='stars'>{stars.map((s,i)=><div key={i} className='star' style={s}/>)}</div>;
}

shared_styles:
@import url('https://fonts.googleapis.com/css2?family=Quicksand:wght@400;600;700&display=swap');
*{margin:0;padding:0;box-sizing:border-box}
body{font-family:'Quicksand',sans-serif;overflow:hidden}
.gw{width:100vw;height:100vh;position:relative;overflow:hidden}
.title-bg{position:absolute;inset:0;display:flex;flex-direction:column;align-items:center;justify-content:center;background:linear-gradient(180deg,#0d0028 0%,#1a0045 50%,#ff69b4 100%);z-index:100}
.title-h{font-size:clamp(2em,6vw,4em);font-weight:700;background:linear-gradient(135deg,#ff69b4,#ff1493,#da70d6,#fff);-webkit-background-clip:text;-webkit-text-fill-color:transparent;text-align:center;line-height:1.2}
.title-sub{color:rgba(255,255,255,0.6);margin:8px 0 28px;font-size:clamp(0.9em,2vw,1.1em)}
.sbtn{background:linear-gradient(135deg,#ff69b4,#ff1493);color:#fff;border:none;padding:14px 44px;border-radius:30px;font-size:1.1em;font-weight:700;cursor:pointer;font-family:inherit;box-shadow:0 4px 20px #ff69b466;transition:.3s}
.sbtn:hover{transform:translateY(-3px);box-shadow:0 8px 30px #ff69b488}
.hud{position:absolute;top:10px;left:10px;z-index:50;display:flex;flex-direction:column;gap:5px}
.pill{background:rgba(0,0,0,.7);border-radius:16px;padding:5px 12px;color:#fff;display:flex;align-items:center;gap:6px;font-size:.82em;backdrop-filter:blur(8px);border:1px solid rgba(255,255,255,.12)}
.dbox{position:absolute;bottom:14px;left:50%;transform:translateX(-50%);width:92%;max-width:700px;background:linear-gradient(135deg,rgba(15,0,35,.95),rgba(35,0,55,.93));border:2px solid rgba(255,140,200,.45);border-radius:14px;padding:18px 22px;color:#fff;z-index:100;backdrop-filter:blur(12px);box-shadow:0 0 40px rgba(255,100,200,.15)}
.dname{font-weight:700;font-size:1em;margin-bottom:5px;text-shadow:0 0 12px currentColor}
.dtext{font-size:.92em;line-height:1.55;min-height:44px}
.dchoices{display:flex;flex-wrap:wrap;gap:7px;margin-top:10px}
.dchoice{background:rgba(255,255,255,.07);border:1px solid rgba(255,140,200,.3);border-radius:8px;padding:7px 16px;color:#fff;cursor:pointer;transition:.2s;font-family:inherit;font-size:.88em}
.dchoice:hover{background:rgba(255,140,200,.22);border-color:rgba(255,140,200,.65);transform:translateY(-2px)}
.dsys{text-align:center;font-size:1.05em;font-weight:700;padding:10px;background:linear-gradient(135deg,#ffd700,#ff69b4);-webkit-background-clip:text;-webkit-text-fill-color:transparent}
.portrait{position:absolute;bottom:20px;right:20px;z-index:90;border-radius:14px;overflow:hidden;border:3px solid rgba(255,140,200,.45);box-shadow:0 0 25px rgba(255,100,200,.2)}
.portrait canvas{display:block}
.toast{position:absolute;top:60px;left:50%;transform:translateX(-50%);z-index:300;background:rgba(0,0,0,.85);color:#fff;padding:8px 22px;border-radius:10px;border:1px solid rgba(255,200,100,.4);animation:sd .3s ease-out;font-size:.88em}
.hint{position:absolute;bottom:10px;left:10px;z-index:50;background:rgba(0,0,0,.55);border-radius:6px;padding:5px 10px;color:rgba(255,255,255,.45);font-size:.72em}
.minfo{position:absolute;left:10px;bottom:60px;z-index:50;max-width:190px}
.mcard{background:rgba(0,0,0,.72);border-radius:10px;padding:10px;color:#fff;border:1px solid rgba(255,255,255,.15);backdrop-filter:blur(8px)}
.mcard h3{margin:0 0 3px;font-size:.9em}
.mcard p{margin:0;font-size:.78em;opacity:.65}
.afbar{height:3px;border-radius:2px;background:rgba(255,255,255,.12);margin-top:5px;overflow:hidden}
.affill{height:100%;border-radius:2px;background:linear-gradient(90deg,#ff69b4,#ff1493);transition:width .5s}
.win-bg{position:absolute;inset:0;z-index:500;display:flex;flex-direction:column;align-items:center;justify-content:center;background:rgba(0,0,0,.85);backdrop-filter:blur(8px)}
.win-h{font-size:clamp(2em,5vw,3em);font-weight:700;background:linear-gradient(135deg,#ffd700,#ff69b4,#da70d6);-webkit-background-clip:text;-webkit-text-fill-color:transparent;margin-bottom:12px;text-align:center}
.back-btn{position:absolute;top:12px;right:12px;z-index:60;background:rgba(0,0,0,.6);border:1px solid rgba(255,255,255,.2);border-radius:8px;padding:6px 14px;color:#fff;cursor:pointer;font-family:inherit;font-size:.85em;transition:.2s;display:flex;align-items:center;gap:4px}
.back-btn:hover{background:rgba(255,255,255,.15)}
.stars{position:absolute;inset:0;overflow:hidden;pointer-events:none}
.star{position:absolute;width:2px;height:2px;background:#fff;border-radius:50%;animation:twinkle 3s infinite}
@keyframes blink{0%,100%{opacity:1}50%{opacity:0}}
@keyframes sd{from{opacity:0;transform:translate(-50%,-15px)}to{opacity:1;transform:translate(-50%,0)}}
@keyframes fu{0%{opacity:1;transform:translateY(0) scale(1)}100%{opacity:0;transform:translateY(-80px) scale(1.5)}}
@keyframes twinkle{0%,100%{opacity:.3}50%{opacity:1}}
@keyframes pulse{0%,100%{opacity:.7;transform:scale(1)}50%{opacity:1;transform:scale(1.05)}}
.dlg-ov{position:absolute;inset:0;z-index:80;display:flex;flex-direction:column;justify-content:flex-end;pointer-events:auto;background:linear-gradient(transparent 30%,rgba(0,0,0,.55) 100%)}
.ebtn{position:absolute;bottom:170px;left:50%;transform:translateX(-50%);z-index:70;background:rgba(255,105,180,.85);color:#fff;border:none;border-radius:25px;padding:12px 28px;font-size:1.1em;font-weight:700;cursor:pointer;font-family:inherit;animation:pulse 1.5s ease infinite;box-shadow:0 0 20px rgba(255,105,180,.4)}
.talk-hint{color:#ff69b4;font-weight:700}

