function GamePage({ data, storage }) {
  const [screen, setScreen] = useState('title');
  const [areaLoc, setAreaLoc] = useState(null);
  const [activeWaifu, setActiveWaifu] = useState(null);
  const [scene, setScene] = useState(null);
  const [lineIdx, setLineIdx] = useState(0);
  const [toast, setToast] = useState(null);
  const [hearts, setHearts] = useState(0);
  const [affs, setAffs] = useState({sakura:0,luna:0,coral:0,ember:0,yuki:0});
  const [crys, setCrys] = useState([]);
  const [seen, setSeen] = useState({sakura:[],luna:[],coral:[],ember:[],yuki:[]});
  const [loaded, setLoaded] = useState(false);
  const [nearW, setNearW] = useState(false);
  const [showDlg, setShowDlg] = useState(false);
  const [questProg, setQuestProg] = useState(0);
  const [questsDone, setQuestsDone] = useState({});

  const islandEl=useRef(null), areaEl=useRef(null);
  const worldRef=useRef(null), areaRef=useRef(null);
  const portCvs=useRef(null), audio=useRef(null);
  const babbleIv=useRef(null), babbleTm=useRef(null);
  const affsR=useRef(affs), crysR=useRef(crys), seenR=useRef(seen);
  const questsDoneR=useRef(questsDone), activeWR=useRef(null);
  const nearWR=useRef(false), showDlgR=useRef(false);
  const locH=useRef(null), interactH=useRef(null);

  useEffect(()=>{affsR.current=affs;},[affs]);
  useEffect(()=>{crysR.current=crys;},[crys]);
  useEffect(()=>{seenR.current=seen;},[seen]);
  useEffect(()=>{questsDoneR.current=questsDone;},[questsDone]);
  useEffect(()=>{activeWR.current=activeWaifu;},[activeWaifu]);

  const curLine = scene?.lines?.[lineIdx] || null;
  const ad = areaLoc ? AREA_DEFS[areaLoc] : null;
  const qDone = areaLoc ? !!questsDone[areaLoc] : false;
  const qTotal = ad ? ad.questCount : 0;
  const qName = ad ? ad.questName : '';

  const save=useCallback((a,c,s,q)=>storage.set('save',{affs:a,crys:c,seen:s,questsDone:q||questsDoneR.current}),[storage]);
  const showToast=useCallback(m=>{setToast(m);setTimeout(()=>setToast(null),3500);},[]);

  const stopBabble=useCallback(()=>{
    if(babbleIv.current){clearInterval(babbleIv.current);babbleIv.current=null;}
    if(babbleTm.current){clearTimeout(babbleTm.current);babbleTm.current=null;}
  },[]);
  const startBabble=useCallback((wid,len)=>{
    stopBabble();
    const p=WAIFUS[wid]?.pitch||1;
    babbleIv.current=setInterval(()=>audio.current?.babble(p),90);
    babbleTm.current=setTimeout(stopBabble,(len||40)*25+200);
  },[stopBabble]);

  useEffect(()=>{
    audio.current=createAudio();
    storage.get('save',null).then(d=>{
      if(d){
        setAffs(d.affs||{sakura:0,luna:0,coral:0,ember:0,yuki:0}); affsR.current=d.affs||{};
        setCrys(d.crys||[]); crysR.current=d.crys||[];
        setSeen(d.seen||{sakura:[],luna:[],coral:[],ember:[],yuki:[]}); seenR.current=d.seen||{};
        if(d.questsDone){setQuestsDone(d.questsDone);questsDoneR.current=d.questsDone;}
      }
      setLoaded(true);
    });
  },[]);

  locH.current=loc=>{
    audio.current?.select();
    const wid=waifuAt(loc);
    if(wid){
      setAreaLoc(loc);setActiveWaifu(wid);setQuestProg(0);
      setShowDlg(false);showDlgR.current=false;
      setNearW(false);nearWR.current=false;
      setScreen('area');
    } else if(loc==='village'){
      showToast(VILLAGE_LINES[Math.floor(Math.random()*VILLAGE_LINES.length)]);
    } else if(loc==='airship'){
      if(crysR.current.length>=5) setScreen('win');
      else showToast(AIRSHIP_LINES[Math.floor(Math.random()*AIRSHIP_LINES.length)]);
    }
  };

  interactH.current=()=>{
    if(!nearWR.current||showDlgR.current) return;
    const wid=activeWR.current; if(!wid) return;
    const aff=affsR.current[wid]||0, s=seenR.current[wid]||[];
    const sc=getNextScene(wid,aff,s);
    if(sc){
      setShowDlg(true);showDlgR.current=true;
      setScene(sc);setLineIdx(0);
      areaRef.current?.pause();
      areaRef.current?.setWaifuTalk(true);
      startBabble(wid,sc.lines[0]?.t?.length);
      const ns={...seenR.current};if(!ns[wid])ns[wid]=[];
      if(!ns[wid].includes(sc.id))ns[wid]=[...ns[wid],sc.id];
      setSeen(ns);seenR.current=ns;
      save(affsR.current,crysR.current,ns);
    } else {
      const ph=['smiles warmly~','waves hello!','seems happy to see you!','giggles softly~'];
      showToast(WAIFUS[wid].emoji+' '+WAIFUS[wid].name+' '+ph[Math.floor(Math.random()*ph.length)]);
    }
  };

  const advance=()=>{
    if(!scene) return;
    const n=lineIdx+1;
    if(n>=scene.lines.length){endDlg();return;}
    const nl=scene.lines[n];
    setLineIdx(n);
    if(!nl.ch&&!nl.sys&&activeWaifu) startBabble(activeWaifu,nl.t?.length);
    if(nl.sys&&scene.crystal&&activeWaifu&&!crysR.current.includes(activeWaifu)){
      const nc=[...crysR.current,activeWaifu];setCrys(nc);crysR.current=nc;
      audio.current?.crystal();save(affsR.current,nc,seenR.current);
    }
  };

  const pickChoice=c=>{
    audio.current?.select();stopBabble();
    if(c.a&&activeWaifu){
      const na={...affsR.current,[activeWaifu]:(affsR.current[activeWaifu]||0)+c.a};
      setAffs(na);affsR.current=na;
      setHearts(c.a);audio.current?.heart();setTimeout(()=>setHearts(0),1500);
      save(na,crysR.current,seenR.current);
    }
    if(c.go&&activeWaifu){
      const rs=getSceneById(activeWaifu,c.go);
      if(rs){
        setScene(rs);setLineIdx(0);
        if(rs.lines[0]&&!rs.lines[0].ch&&!rs.lines[0].sys) startBabble(activeWaifu,rs.lines[0].t?.length);
        const ns={...seenR.current};if(!ns[activeWaifu])ns[activeWaifu]=[];
        if(!ns[activeWaifu].includes(rs.id))ns[activeWaifu]=[...ns[activeWaifu],rs.id];
        setSeen(ns);seenR.current=ns;save(affsR.current,crysR.current,ns);return;
      }
    }
    endDlg();
  };

  const endDlg=()=>{
    stopBabble();
    setShowDlg(false);showDlgR.current=false;
    setScene(null);
    areaRef.current?.resume();
    areaRef.current?.setWaifuTalk(false);
  };

  const leaveArea=()=>{
    stopBabble();
    setScreen('map');setAreaLoc(null);setActiveWaifu(null);
    setShowDlg(false);showDlgR.current=false;setScene(null);
  };

  const startGame=()=>{audio.current?.click();audio.current?.startMusic();setScreen('map');};

  useEffect(()=>{
    if(screen!=='map'||!islandEl.current) return;
    const w=createIslandWorld(islandEl.current,loc=>locH.current?.(loc));
    worldRef.current=w;
    return()=>{w.dispose();worldRef.current=null;};
  },[screen]);

  useEffect(()=>{
    if(screen!=='area'||!areaEl.current||!activeWaifu||!areaLoc) return;
    const wid=activeWaifu, aloc=areaLoc;
    const aw=createAreaWorld(areaEl.current,aloc,wid,{
      onNearWaifu:()=>{nearWR.current=true;setNearW(true);},
      onLeaveWaifu:()=>{nearWR.current=false;setNearW(false);},
      onCollect:(idx,cnt)=>{
        setQuestProg(cnt);audio.current?.select();
        if(cnt>=AREA_DEFS[aloc].questCount){
          setTimeout(()=>{
            if(!questsDoneR.current[aloc]){
              const nqd={...questsDoneR.current,[aloc]:true};
              setQuestsDone(nqd);questsDoneR.current=nqd;
              const na={...affsR.current,[wid]:(affsR.current[wid]||0)+10};
              setAffs(na);affsR.current=na;
              setHearts(10);audio.current?.heart();setTimeout(()=>setHearts(0),1500);
              showToast(String.fromCodePoint(0x2728)+' Quest Complete! +10 affection with '+WAIFUS[wid].name+'!');
              save(na,crysR.current,seenR.current,nqd);
            } else {
              showToast(String.fromCodePoint(0x2705)+' '+WAIFUS[wid].name+' appreciates your help again~');
            }
          },500);
        }
      },
      onInteract:()=>interactH.current?.()
    });
    areaRef.current=aw;
    return()=>{aw.dispose();areaRef.current=null;setNearW(false);setShowDlg(false);showDlgR.current=false;stopBabble();};
  },[screen,areaLoc,activeWaifu]);

  useEffect(()=>{
    if(showDlg&&activeWaifu&&portCvs.current){
      const line=scene?.lines?.[lineIdx];
      drawPortrait(portCvs.current,activeWaifu,line?.e||'happy');
      areaRef.current?.setWaifuExpr(line?.e||'happy');
    }
  },[showDlg,activeWaifu,lineIdx,scene]);

  return (
    <div className='gw'>
      {screen==='title'&&(
        <div className='title-bg'><StarField/>
          <div style={{zIndex:10,textAlign:'center',padding:20}}>
            <div style={{fontSize:'3.5em',marginBottom:4,filter:'drop-shadow(0 0 20px rgba(255,105,180,0.5))'}}>{String.fromCodePoint(0x1F3DD,0xFE0F)}</div>
            <h1 className='title-h'>Waifu Island</h1>
            <div className='title-sub'>~ Starfall Beach ~</div>
            <p style={{color:'rgba(255,255,255,.45)',maxWidth:380,margin:'0 auto 24px',fontSize:'.86em',lineHeight:1.7}}>
              Your airship crashed on a mysterious island.<br/>Meet five magical guardians, earn their trust,<br/>and collect the crystals to find your way home...
            </p>
            <button className='sbtn' onClick={startGame}>{String.fromCodePoint(0x2728)} Begin Adventure {String.fromCodePoint(0x2728)}</button>
            {loaded&&crys.length>0&&<div style={{color:'rgba(255,255,255,.35)',marginTop:12,fontSize:'.78em'}}>{String.fromCodePoint(0x1F4BE)} Save found: {crys.length}/5 crystals</div>}
          </div>
        </div>
      )}

      {screen==='map'&&(
        <>
          <div ref={islandEl} style={{width:'100%',height:'100%'}}/>
          <div className='hud'>
            <div className='pill'>{String.fromCodePoint(0x1F48E)} {crys.length}/5 Crystals</div>
            {Object.entries(WAIFUS).map(([k,w])=>(
              <div key={k} className='pill' style={{fontSize:'.75em',opacity:crys.includes(k)?.9:.65}}>
                {w.emoji} {w.name}{' '}
                <span style={{color:w.color}}>{String.fromCodePoint(0x2665)}{affs[k]||0}</span>
                {crys.includes(k)&&<span style={{color:'#ffd700'}}> {String.fromCodePoint(0x2713)}</span>}
                {questsDone[w.loc]&&<span style={{color:'#4fc3f7'}}> {String.fromCodePoint(0x2605)}</span>}
              </div>
            ))}
          </div>
          <div className='hint'>{String.fromCodePoint(0x1F5B1,0xFE0F)} Drag to orbit {String.fromCodePoint(0x2022)} Scroll to zoom {String.fromCodePoint(0x2022)} Click markers to explore</div>
        </>
      )}

      {screen==='area'&&(
        <>
          <div ref={areaEl} style={{width:'100%',height:'100%'}}/>
          <div className='hud'>
            <div className='pill' style={{background:qDone?'rgba(76,175,80,.35)':'rgba(0,0,0,.6)'}}>
              {qDone?String.fromCodePoint(0x2705):String.fromCodePoint(0x1F50D)} {qName}: {Math.min(questProg,qTotal)}/{qTotal}
            </div>
            {activeWaifu&&(
              <div className='pill'>
                {WAIFUS[activeWaifu].emoji} {WAIFUS[activeWaifu].name}{' '}
                <span style={{color:WAIFUS[activeWaifu].color}}>{String.fromCodePoint(0x2665)}{affs[activeWaifu]||0}</span>
              </div>
            )}
            <div className='pill'>{String.fromCodePoint(0x1F48E)} {crys.length}/5</div>
          </div>
          <button className='back-btn' onClick={leaveArea}>{String.fromCodePoint(0x2190)} Map</button>
          <div className='hint'>
            WASD / Arrows to move {String.fromCodePoint(0x2022)} E to interact
            {nearW&&!showDlg&&<span className='talk-hint'> {String.fromCodePoint(0x2022)} Press E to talk to {WAIFUS[activeWaifu]?.name}!</span>}
          </div>
          {nearW&&!showDlg&&(
            <button className='ebtn' onClick={()=>interactH.current?.()}>
              {String.fromCodePoint(0x1F4AC)} Talk
            </button>
          )}
          {showDlg&&activeWaifu&&(
            <div className='dlg-ov'>
              <div className='portrait'><canvas ref={portCvs}/></div>
              {curLine&&!curLine.ch&&!curLine.sys&&(
                <div className='dbox' onClick={advance}>
                  <div className='dname' style={{color:WAIFUS[activeWaifu].color}}>{WAIFUS[activeWaifu].emoji} {WAIFUS[activeWaifu].name}</div>
                  <div className='dtext'><TypingText text={curLine.t} key={scene?.id+'-'+lineIdx}/></div>
                  <div style={{textAlign:'right',opacity:.3,fontSize:'.72em',marginTop:6}}>Click to continue...</div>
                </div>
              )}
              {curLine&&curLine.sys&&(
                <div className='dbox' onClick={advance}>
                  <div className='dsys'>{curLine.sys}</div>
                  <div style={{textAlign:'right',opacity:.3,fontSize:'.72em',marginTop:6}}>Click to continue...</div>
                </div>
              )}
              {curLine&&curLine.ch&&(
                <div className='dbox'>
                  <div className='dname' style={{color:WAIFUS[activeWaifu].color}}>{String.fromCodePoint(0x1F4AD)} What will you say?</div>
                  <div className='dchoices'>
                    {curLine.ch.map((c,i)=><button key={i} className='dchoice' onClick={()=>pickChoice(c)}>{c.t}</button>)}
                  </div>
                </div>
              )}
            </div>
          )}
        </>
      )}

      {screen==='win'&&(
        <div className='win-bg'><StarField/>
          <div style={{zIndex:10,textAlign:'center',padding:20}}>
            <div style={{fontSize:'4em',marginBottom:12}}>{String.fromCodePoint(0x2728,0x1F3DD,0xFE0F,0x2728)}</div>
            <h1 className='win-h'>You Did It!</h1>
            <p style={{color:'rgba(255,255,255,.7)',maxWidth:420,margin:'0 auto 20px',lineHeight:1.7}}>
              All five crystals glow in your hands.<br/>Your airship hums to life...<br/>
              But looking back at the island, at them...<br/>Maybe you'll stay a little longer~ {String.fromCodePoint(0x1F495)}
            </p>
            <div style={{display:'flex',gap:20,justifyContent:'center',marginBottom:24,flexWrap:'wrap'}}>
              {Object.entries(WAIFUS).map(([k,w])=><div key={k} style={{textAlign:'center'}}>
                <div style={{fontSize:'1.8em'}}>{w.emoji}</div>
                <div style={{color:w.color,fontSize:'.85em',fontWeight:700}}>{w.name}</div>
                <div style={{color:'rgba(255,255,255,.4)',fontSize:'.72em'}}>{String.fromCodePoint(0x2665)} {affs[k]||0}</div>
              </div>)}
            </div>
            <button className='sbtn' onClick={()=>setScreen('map')}>Return to Island {String.fromCodePoint(0x1F495)}</button>
          </div>
        </div>
      )}

      {toast&&<div className='toast'>{toast}</div>}
      {hearts>0&&<div style={{position:'absolute',inset:0,pointerEvents:'none',zIndex:200}}>
        {Array.from({length:Math.min(hearts,10)},(_,i)=><span key={i} style={{
          position:'absolute',left:(20+Math.random()*60)+'%',top:'30%',
          fontSize:(1.2+Math.random()*.8)+'em',animation:'fu 1.5s ease-out '+i*.1+'s forwards',opacity:0
