function getNextScene(wid, aff, seen) {
  const sc = SCENES[wid]; if(!sc) return null;
  const crystal = sc.find(s => s.crystal && (s.min===undefined||aff>=s.min) && !seen.includes(s.id));
  if(crystal) return crystal;
  const intro = sc.find(s => s.once && !s.crystal && (s.min===undefined||aff>=s.min) && !seen.includes(s.id));
  if(intro) return intro;
  const chats = sc.filter(s => !s.once && !s.crystal && s.min!==undefined && aff>=s.min && !s.lines[0].ch);
  if(chats.length) return chats[Math.floor(Math.random()*chats.length)];
  return null;
}
function getSceneById(wid, sid) { return SCENES[wid]?.find(s => s.id===sid) || null; }

// ===== THREE.JS 3D ISLAND SCENE =====
function createIslandWorld(container, onClickLocation) {
  const scene = new THREE.Scene();
  scene.background = new THREE.Color(0x87ceeb);
  scene.fog = new THREE.FogExp2(0x87ceeb, 0.005);
  const W = container.clientWidth, H = container.clientHeight;
  const camera = new THREE.PerspectiveCamera(55, W/H, 0.1, 500);
  const renderer = new THREE.WebGLRenderer({ antialias:true });
  renderer.setSize(W, H);
  renderer.setPixelRatio(Math.min(window.devicePixelRatio, 2));
  renderer.shadowMap.enabled = true;
  container.appendChild(renderer.domElement);

  // Lights
  scene.add(new THREE.AmbientLight(0xffeedd, 0.65));
  const sun = new THREE.DirectionalLight(0xffffff, 1.0);
  sun.position.set(25, 40, 15); sun.castShadow = true;
  scene.add(sun);
  const rimLight = new THREE.DirectionalLight(0xff69b4, 0.3);
  rimLight.position.set(-20, 10, -10); scene.add(rimLight);

  // Ocean
  const wGeo = new THREE.PlaneGeometry(300, 300, 48, 48);
  const wMat = new THREE.MeshPhongMaterial({color:0x0077be, transparent:true, opacity:0.82, shininess:120, flatShading:true});
  const water = new THREE.Mesh(wGeo, wMat);
  water.rotation.x = -Math.PI/2; water.position.y = -1; scene.add(water);

  // Island base
  const iGeo = new THREE.CylinderGeometry(20, 23, 4, 16, 3);
  const pos = iGeo.attributes.position;
  for(let i=0; i<pos.count; i++) {
    const x=pos.getX(i), z=pos.getZ(i), y=pos.getY(i);
    if(y>0) pos.setY(i, y + Math.sin(x*0.3)*Math.cos(z*0.4)*1.2 + Math.sin(x*0.7+z*0.5)*0.6);
    const d=Math.sqrt(x*x+z*z);
    if(d>14){const a=Math.atan2(z,x); const nr=d+Math.sin(a*6)*1.5+Math.cos(a*3)*1; pos.setX(i,Math.cos(a)*nr); pos.setZ(i,Math.sin(a)*nr);}
  }
  iGeo.computeVertexNormals();
  const island = new THREE.Mesh(iGeo, new THREE.MeshLambertMaterial({color:0x6dbf4a, flatShading:true}));
  island.receiveShadow = true; scene.add(island);

  // Beach rim
  const bch = new THREE.Mesh(new THREE.TorusGeometry(22, 2.8, 6, 16),
    new THREE.MeshLambertMaterial({color:0xf0d58c, flatShading:true}));
  bch.rotation.x = Math.PI/2; bch.position.y = -0.8; scene.add(bch);

  // Hills
  function addHill(x,z,h,r,col){const m=new THREE.Mesh(new THREE.ConeGeometry(r,h,7),new THREE.MeshLambertMaterial({color:col,flatShading:true}));m.position.set(x,h/2+1.5,z);m.castShadow=true;scene.add(m);}
  addHill(0,-14,14,7,0x8b4513); addHill(0,-13.5,5,3.5,0xff4500); // volcano
  addHill(-10,-2,7,5.5,0x5d8a3c); addHill(9,-5,5.5,4.5,0x3d6b2e);
  addHill(-6,-12,5,4,0x7ba4c7); addHill(5,8,3,3,0x6dbf4a);

  // Trees
  function addTree(x,z,lc){lc=lc||0x228b22;const t=new THREE.Mesh(new THREE.CylinderGeometry(0.2,0.3,2.5,4),new THREE.MeshLambertMaterial({color:0x8b6914}));t.position.set(x,3.5,z);scene.add(t);const l=new THREE.Mesh(new THREE.SphereGeometry(1.4,6,4),new THREE.MeshLambertMaterial({color:lc,flatShading:true}));l.position.set(x,5.5,z);l.castShadow=true;scene.add(l);}
  for(let i=0;i<14;i++){const a=(i/14)*Math.PI*2,r=9+Math.random()*6; addTree(Math.cos(a)*r, Math.sin(a)*r);}
  addTree(-13,-1,0xff69b4); addTree(-11,-4,0xff8fab); addTree(-14,0,0xffb7d5); addTree(-10,-5,0xff69b4);

  // Small structures
  // Temple gate
  const gate = new THREE.Mesh(new THREE.BoxGeometry(0.4,4,0.4), new THREE.MeshLambertMaterial({color:0xcc0000}));
  gate.position.set(-12,4,-1); scene.add(gate);
  const gateTop = new THREE.Mesh(new THREE.BoxGeometry(3,0.3,0.5), new THREE.MeshLambertMaterial({color:0xcc0000}));
  gateTop.position.set(-12,6,-1); scene.add(gateTop);
  // Tower
  const twr = new THREE.Mesh(new THREE.CylinderGeometry(1,1.3,8,6), new THREE.MeshLambertMaterial({color:0x4a148c,flatShading:true}));
  twr.position.set(10,-5,6); twr.castShadow=true; scene.add(twr);
  const twrRoof = new THREE.Mesh(new THREE.ConeGeometry(2,3,6), new THREE.MeshLambertMaterial({color:0x6a1b9a,flatShading:true}));
  twrRoof.position.set(10,-5,10); scene.add(twrRoof); // placed oddly on purpose for visual

  // Location markers
  const markers = {}, markerMeshes = [];
  Object.entries(LOCATIONS).forEach(([key, loc]) => {
    const g = new THREE.Group();
    const sph = new THREE.Mesh(new THREE.SphereGeometry(0.7,12,12),
      new THREE.MeshBasicMaterial({color:new THREE.Color(loc.color),transparent:true,opacity:0.9,depthTest:false}));
    sph.userData.locationKey = key; g.add(sph); markerMeshes.push(sph);
    const ring = new THREE.Mesh(new THREE.TorusGeometry(1.1,0.06,8,24),
      new THREE.MeshBasicMaterial({color:new THREE.Color(loc.color),transparent:true,opacity:0.5,depthTest:false}));
    ring.rotation.x = Math.PI/2; g.add(ring);
    const pil = new THREE.Mesh(new THREE.CylinderGeometry(0.08,0.3,14,6),
      new THREE.MeshBasicMaterial({color:new THREE.Color(loc.color),transparent:true,opacity:0.15,depthTest:false}));
    pil.position.y = -3; g.add(pil);
    g.position.set(loc.x, 9, loc.z); scene.add(g);
    markers[key] = {group:g, sphere:sph, ring:ring};
  });

  // Camera orbit
  let camA=Math.PI*0.25, camE=32, camD=42;
  let tA=camA, tE=camE;
  let drag=false, ds={x:0,y:0}, cs={x:0,y:0};
  const cv = renderer.domElement;
  cv.style.cursor='grab'; cv.style.touchAction='none';
  cv.addEventListener('pointerdown',e=>{drag=true;ds={x:e.clientX,y:e.clientY};cs={x:e.clientX,y:e.clientY};cv.style.cursor='grabbing';});
  cv.addEventListener('pointermove',e=>{if(!drag)return;tA+=(e.clientX-ds.x)*0.005;tE=Math.max(12,Math.min(55,tE-(e.clientY-ds.y)*0.15));ds={x:e.clientX,y:e.clientY};});
  cv.addEventListener('pointerup',e=>{const dx=e.clientX-cs.x,dy=e.clientY-cs.y;drag=false;cv.style.cursor='grab';
    if(Math.sqrt(dx*dx+dy*dy)<6){const rect=cv.getBoundingClientRect();const m=new THREE.Vector2(((e.clientX-rect.left)/rect.width)*2-1,-((e.clientY-rect.top)/rect.height)*2+1);
    const rc=new THREE.Raycaster();rc.setFromCamera(m,camera);const h=rc.intersectObjects(markerMeshes);
    if(h.length>0&&h[0].object.userData.locationKey) onClickLocation(h[0].object.userData.locationKey);}
  });
  cv.addEventListener('wheel',e=>{camD=Math.max(18,Math.min(65,camD+e.deltaY*0.04));},{passive:true});

  // Particles
  const PC=100, pGeo=new THREE.BufferGeometry();
  const pp=new Float32Array(PC*3), pc=new Float32Array(PC*3);
  for(let i=0;i<PC;i++){pp[i*3]=(Math.random()-.5)*70;pp[i*3+1]=Math.random()*25+2;pp[i*3+2]=(Math.random()-.5)*70;
    pc[i*3]=1;pc[i*3+1]=.6+Math.random()*.3;pc[i*3+2]=.7+Math.random()*.3;}
  pGeo.setAttribute('position',new THREE.BufferAttribute(pp,3));
  pGeo.setAttribute('color',new THREE.BufferAttribute(pc,3));
  scene.add(new THREE.Points(pGeo, new THREE.PointsMaterial({size:0.35,vertexColors:true,transparent:true,opacity:0.7})));

  // Animate
  let fid; const clk = new THREE.Clock();
  let hoveredLoc = null;
  function animate(){
    fid=requestAnimationFrame(animate); const t=clk.getElapsedTime();
    camA+=(tA-camA)*0.07; camE+=(tE-camE)*0.07;
    camera.position.set(Math.sin(camA)*camD, camE, Math.cos(camA)*camD); camera.lookAt(0,2,0);
    // Water
    const wp=wGeo.attributes.position;
    for(let i=0;i<wp.count;i++){const x=wp.getX(i),z=wp.getZ(i);wp.setY(i,Math.sin(x*.12+t)*.5+Math.cos(z*.12+t*.7)*.4);}
    wp.needsUpdate=true;
    // Markers bob + ring spin
    Object.values(markers).forEach((m,i)=>{m.group.position.y=9+Math.sin(t*2+i*1.3)*.5;m.ring.rotation.z=t*.5+i;});
    // Particles fall
    const ppa=pGeo.attributes.position;
    for(let i=0;i<PC;i++){let y=ppa.getY(i)-.015,x=ppa.getX(i)+Math.sin(t*.5+i)*.008;
      if(y<0){y=25;x=(Math.random()-.5)*70;} ppa.setX(i,x);ppa.setY(i,y);}
    ppa.needsUpdate=true;
    renderer.render(scene,camera);
  }
  animate();
  function onResize(){camera.aspect=container.clientWidth/container.clientHeight;camera.updateProjectionMatrix();renderer.setSize(container.clientWidth,container.clientHeight);}
  window.addEventListener('resize',onResize);
  return {
    dispose(){cancelAnimationFrame(fid);window.removeEventListener('resize',onResize);renderer.dispose();if(container.contains(cv))container.removeChild(cv);},
    highlight(key){Object.entries(markers).forEach(([k,m])=>{const s=k===key?1.5:1;m.group.scale.setScalar(s);});}
  };
}

// ===== ANIME PORTRAIT RENDERER + AUDIO ENGINE =====

function drawPortrait(canvas, waifuId, expression) {
  const w = WAIFUS[waifuId]; if(!w) return;
  const ctx = canvas.getContext('2d');
  const CW = canvas.width = 220, CH = canvas.height = 300;
  // BG gradient
  const bg = ctx.createRadialGradient(CW/2,CH/2,10,CW/2,CH/2,CW);
  bg.addColorStop(0, w.color+'50'); bg.addColorStop(1, w.color+'15');
  ctx.fillStyle = bg; ctx.fillRect(0,0,CW,CH);
  // Sparkles
  ctx.fillStyle = w.color+'35';
  for(let i=0;i<12;i++){ctx.beginPath();ctx.arc(15+Math.random()*(CW-30),10+Math.random()*(CH-20),1+Math.random()*2.5,0,Math.PI*2);ctx.fill();}
  const cx=CW/2, fy=145;
  // Hair back
  ctx.fillStyle=w.hair;
  ctx.beginPath();ctx.ellipse(cx,fy-8,60,72,0,0,Math.PI*2);ctx.fill();
  ctx.fillRect(cx-58,fy-8,16,95);ctx.fillRect(cx+42,fy-8,16,95); // side hair
  // Neck + shoulders
  ctx.fillStyle=w.skin; ctx.fillRect(cx-10,fy+40,20,25);
  ctx.fillStyle=w.outfit;
  ctx.beginPath();ctx.ellipse(cx,fy+88,55,30,0,Math.PI,0);ctx.fill();
  ctx.beginPath();ctx.moveTo(cx-30,fy+58);ctx.lineTo(cx+30,fy+58);ctx.lineTo(cx+50,fy+88);ctx.lineTo(cx-50,fy+88);ctx.fill();
  // Face
  ctx.fillStyle=w.skin;
  ctx.beginPath();ctx.ellipse(cx,fy+2,43,50,0,0,Math.PI*2);ctx.fill();
  // Bangs
  ctx.fillStyle=w.hair;
  ctx.beginPath();ctx.moveTo(cx-48,fy-18);ctx.quadraticCurveTo(cx-20,fy-55,cx,fy-48);
  ctx.quadraticCurveTo(cx+20,fy-55,cx+48,fy-18);ctx.quadraticCurveTo(cx+35,fy-40,cx,fy-42);
  ctx.quadraticCurveTo(cx-35,fy-40,cx-48,fy-18);ctx.fill();
  // Hair strands
  ctx.strokeStyle=w.hair; ctx.lineWidth=3;
  ctx.beginPath();ctx.moveTo(cx-20,fy-42);ctx.quadraticCurveTo(cx-25,fy-20,cx-18,fy-10);ctx.stroke();
  ctx.beginPath();ctx.moveTo(cx+20,fy-42);ctx.quadraticCurveTo(cx+25,fy-20,cx+18,fy-10);ctx.stroke();
  // Eyes
  const expr = expression || 'happy';
  const eyeY = fy-2, eyeL = cx-16, eyeR = cx+16;
  if(expr==='love') {
    ctx.fillStyle='#ff1493'; ctx.font='20px serif';
    ctx.fillText('\u2665',eyeL-10,eyeY+7); ctx.fillText('\u2665',eyeR-10,eyeY+7);
  } else if(expr==='scared'||expr==='surprised') {
    [eyeL,eyeR].forEach(ex=>{ctx.fillStyle='#fff';ctx.beginPath();ctx.ellipse(ex,eyeY,12,14,0,0,Math.PI*2);ctx.fill();
      ctx.fillStyle=w.eye;ctx.beginPath();ctx.arc(ex,eyeY+1,7,0,Math.PI*2);ctx.fill();
      ctx.fillStyle='#000';ctx.beginPath();ctx.arc(ex,eyeY+2,4,0,Math.PI*2);ctx.fill();
      ctx.fillStyle='#fff';ctx.beginPath();ctx.arc(ex+3,eyeY-3,3,0,Math.PI*2);ctx.fill();
      ctx.beginPath();ctx.arc(ex-2,eyeY+3,1.5,0,Math.PI*2);ctx.fill();});
  } else if(expr==='sad'||expr==='cry_happy') {
    [eyeL,eyeR].forEach(ex=>{ctx.fillStyle='#fff';ctx.beginPath();ctx.ellipse(ex,eyeY,10,8,0,0,Math.PI*2);ctx.fill();
      ctx.fillStyle=w.eye;ctx.beginPath();ctx.arc(ex,eyeY+1,5,0,Math.PI*2);ctx.fill();
      ctx.fillStyle='#000';ctx.beginPath();ctx.arc(ex,eyeY+2,3,0,Math.PI*2);ctx.fill();
      ctx.fillStyle='#fff';ctx.beginPath();ctx.arc(ex+2,eyeY-2,2,0,Math.PI*2);ctx.fill();
      if(expr==='cry_happy'){ctx.fillStyle='#64b5f6';ctx.beginPath();ctx.ellipse(ex,eyeY+16,3,6,0,0,Math.PI*2);ctx.fill();}});
  } else if(expr==='angry'||expr==='tsun'||expr==='stern') {
    [eyeL,eyeR].forEach((ex,idx)=>{ctx.fillStyle='#fff';ctx.beginPath();ctx.ellipse(ex,eyeY,10,10,0,0,Math.PI*2);ctx.fill();
      ctx.fillStyle=w.eye;ctx.beginPath();ctx.arc(ex,eyeY+1,6,0,Math.PI*2);ctx.fill();
      ctx.fillStyle='#000';ctx.beginPath();ctx.arc(ex,eyeY+2,3.5,0,Math.PI*2);ctx.fill();
      ctx.fillStyle='#fff';ctx.beginPath();ctx.arc(ex+2,eyeY-2,2,0,Math.PI*2);ctx.fill();
      ctx.strokeStyle=w.hair;ctx.lineWidth=3;ctx.beginPath();
      const dir=idx===0?1:-1; ctx.moveTo(ex-8*dir,eyeY-14);ctx.lineTo(ex+8*dir,eyeY-10);ctx.stroke();});
  } else { // happy, shy, blush, think, etc
    const sz = (expr==='blush'||expr==='shy') ? 8 : 10;
    [eyeL,eyeR].forEach(ex=>{ctx.fillStyle='#fff';ctx.beginPath();ctx.ellipse(ex,eyeY,sz+1,sz+2,0,0,Math.PI*2);ctx.fill();
      ctx.fillStyle=w.eye;ctx.beginPath();ctx.arc(ex,eyeY+1,sz-3,0,Math.PI*2);ctx.fill();
      ctx.fillStyle='#000';ctx.beginPath();ctx.arc(ex,eyeY+2,sz-5,0,Math.PI*2);ctx.fill();
      ctx.fillStyle='#fff';ctx.beginPath();ctx.arc(ex+2,eyeY-2,sz>9?3:2,0,Math.PI*2);ctx.fill();
      ctx.beginPath();ctx.arc(ex-1,eyeY+3,1.5,0,Math.PI*2);ctx.fill();});
  }
  // Blush cheeks
  if(['blush','love','shy','happy','cry_happy','hopeful'].includes(expr)){
    ctx.fillStyle='rgba(255,130,150,0.35)';ctx.beginPath();ctx.ellipse(cx-22,fy+12,9,5,-.2,0,Math.PI*2);ctx.fill();
    ctx.beginPath();ctx.ellipse(cx+22,fy+12,9,5,.2,0,Math.PI*2);ctx.fill();
  }
  // Nose
  ctx.fillStyle=w.skin+'cc'; ctx.beginPath();ctx.arc(cx,fy+10,1.5,0,Math.PI*2);ctx.fill();
  // Mouth
  ctx.strokeStyle='#c06070'; ctx.lineWidth=2; ctx.beginPath();
  if(expr==='happy'||expr==='excited'||expr==='love'||expr==='hopeful'){ctx.arc(cx,fy+20,6,0.1,Math.PI-0.1);}
  else if(expr==='sad'||expr==='cry_happy'){ctx.arc(cx,fy+24,5,Math.PI+0.2,-0.2);}
  else if(expr==='angry'||expr==='tsun'||expr==='stern'){ctx.moveTo(cx-6,fy+20);ctx.lineTo(cx+6,fy+20);}
  else if(expr==='surprised'||expr==='excited'){ctx.ellipse(cx,fy+22,5,6,0,0,Math.PI*2);ctx.fillStyle='#c06070';ctx.fill();}
  else if(expr==='blush'||expr==='shy'){ctx.arc(cx,fy+20,4,0.2,Math.PI-0.2);}
  else{ctx.arc(cx,fy+20,5,0.1,Math.PI-0.1);}
  ctx.stroke();
  // Expression extras
  if(expr==='love'){ctx.fillStyle='#ff69b4';ctx.font='14px serif';ctx.fillText('\u2665',cx+30,fy-20);ctx.fillText('\u2665',cx-40,fy-15);}
  if(expr==='excited'){ctx.fillStyle='#ffd700';ctx.font='12px serif';ctx.fillText('\u2728',cx+32,fy-10);ctx.fillText('\u2728',cx-42,fy-5);}
  // Name plate
  ctx.fillStyle='rgba(0,0,0,0.5)'; roundRect(ctx,10,CH-40,CW-20,30,8); ctx.fill();
  ctx.fillStyle=w.color; ctx.font='bold 13px Quicksand,sans-serif'; ctx.textAlign='center';
  ctx.fillText(w.emoji+' '+w.name+' '+w.emoji, cx, CH-20); ctx.textAlign='start';
}
function roundRect(ctx,x,y,w,h,r){ctx.beginPath();ctx.moveTo(x+r,y);ctx.lineTo(x+w-r,y);ctx.quadraticCurveTo(x+w,y,x+w,y+r);
  ctx.lineTo(x+w,y+h-r);ctx.quadraticCurveTo(x+w,y+h,x+w-r,y+h);ctx.lineTo(x+r,y+h);
  ctx.quadraticCurveTo(x,y+h,x,y+h-r);ctx.lineTo(x,y+r);ctx.quadraticCurveTo(x,y,x+r,y);ctx.closePath();}

// ===== AUDIO ENGINE (Web Audio API) =====
function createAudio() {
  let ctx = null;
  function init() { if(!ctx) try{ctx=new(window.AudioContext||window.webkitAudioContext)();}catch(e){} return ctx; }
  function playTone(freq, dur, type, vol, pitch) {
    const c = init(); if(!c) return;
    try {
      const o=c.createOscillator(), g=c.createGain();
      o.type=type||'sine'; o.frequency.value=freq*(pitch||1);
      g.gain.setValueAtTime(vol||0.1,c.currentTime); g.gain.exponentialRampToValueAtTime(0.001,c.currentTime+dur);
      o.connect(g); g.connect(c.destination); o.start(); o.stop(c.currentTime+dur);
    } catch(e){}
  }
  return {
    babble(pitch) {
      const c=init();if(!c)return;
      try{
        const p=pitch||1;
        const vowels=[[800,1200],[300,2300],[350,900],[500,1800],[500,800]];
        const v=vowels[Math.floor(Math.random()*vowels.length)];
        const dur=0.06+Math.random()*0.04;const now=c.currentTime;
        const o1=c.createOscillator(),g1=c.createGain();
        o1.type='sine';o1.frequency.setValueAtTime(v[0]*p,now);
        o1.frequency.linearRampToValueAtTime(v[1]*p*0.4,now+dur);
        g1.gain.setValueAtTime(0.06,now);g1.gain.exponentialRampToValueAtTime(0.001,now+dur);
        o1.connect(g1);g1.connect(c.destination);o1.start(now);o1.stop(now+dur);
        const o2=c.createOscillator(),g2=c.createGain();
        o2.type='triangle';o2.frequency.setValueAtTime(v[0]*p*1.5,now);
        g2.gain.setValueAtTime(0.02,now);g2.gain.exponentialRampToValueAtTime(0.001,now+dur*0.7);
        o2.connect(g2);g2.connect(c.destination);o2.start(now);o2.stop(now+dur);
      }catch(e){}
    },
    boop(pitch) { // dialogue text sound (like Animal Crossing)
      const p = pitch||1;
      playTone(280*p, 0.08, 'sine', 0.06, 1);
      setTimeout(()=>playTone(350*p, 0.06, 'sine', 0.04, 1), 40);
    },
    heart() { // affection gain
      playTone(523, 0.15, 'sine', 0.1); setTimeout(()=>playTone(659, 0.15, 'sine', 0.1), 100);
      setTimeout(()=>playTone(784, 0.2, 'sine', 0.12), 200);
    },
    crystal() { // crystal received
      [523,659,784,1047].forEach((f,i)=>setTimeout(()=>playTone(f,0.3,'sine',0.1),i*120));
    },
    click() { playTone(800, 0.05, 'square', 0.04); },
    select() { playTone(600, 0.08, 'sine', 0.06); setTimeout(()=>playTone(900,0.1,'sine',0.06),60); },
    startMusic() {
      const c = init(); if(!c) return;
      try {
        // Romantic anime background music - Am F C G progression
        const chords=[[220,262,330],[175,220,262],[262,330,392],[196,247,294]];
        const mel=[[659,587,523,494],[440,392,440,523],[659,784,659,587],[494,440,392,440]];
        let ci=0;
        const playSection=()=>{
          if(!c||c.state==='closed')return;
          const ch=chords[ci%4],mn=mel[ci%4];
          // Warm pad - sustained chord an octave below
          ch.forEach(f=>{const o=c.createOscillator(),g=c.createGain();o.type='triangle';o.frequency.value=f*0.5;
            g.gain.setValueAtTime(0.015,c.currentTime);g.gain.exponentialRampToValueAtTime(0.001,c.currentTime+3);
            o.connect(g);g.connect(c.destination);o.start();o.stop(c.currentTime+3.2);});
          // Arpeggio - gentle broken chord
          for(let i=0;i<4;i++){const f=ch[i%3];setTimeout(()=>{
            if(!c||c.state==='closed')return;const o=c.createOscillator(),g=c.createGain();
            o.type='sine';o.frequency.value=f;g.gain.setValueAtTime(0.028,c.currentTime);
            g.gain.exponentialRampToValueAtTime(0.001,c.currentTime+1.2);
            o.connect(g);g.connect(c.destination);o.start();o.stop(c.currentTime+1.2);},i*400);}
          // Melody - singable top line with octave echo
          mn.forEach((f,i)=>{setTimeout(()=>{
            if(!c||c.state==='closed')return;
            const o=c.createOscillator(),g=c.createGain();o.type='sine';o.frequency.value=f;
            g.gain.setValueAtTime(0.04,c.currentTime);g.gain.exponentialRampToValueAtTime(0.001,c.currentTime+0.7);
            o.connect(g);g.connect(c.destination);o.start();o.stop(c.currentTime+0.75);
            const o2=c.createOscillator(),g2=c.createGain();o2.type='sine';o2.frequency.value=f*0.5;
            g2.gain.setValueAtTime(0.012,c.currentTime);g2.gain.exponentialRampToValueAtTime(0.001,c.currentTime+0.5);
            o2.connect(g2);g2.connect(c.destination);o2.start();o2.stop(c.currentTime+0.5);},i*800);});
          ci++;setTimeout(playSection,3200);
        };
        playSection();
      } catch(e){}
    }
  };
}

// ===== 3D ANIME WAIFU MODEL BUILDER =====
function _p(m,x,y,z){m.position.set(x,y,z);return m;}

function createWaifu3D(waifuId) {
  const w = WAIFUS[waifuId]; if(!w) return null;
  const root = new THREE.Group();
  const skinM = new THREE.MeshLambertMaterial({color:w.skin});
  const hairM = new THREE.MeshLambertMaterial({color:w.hair,flatShading:true});
  const outM = new THREE.MeshLambertMaterial({color:w.outfit});
  const eyeM = new THREE.MeshBasicMaterial({color:w.eye});
  const whtM = new THREE.MeshBasicMaterial({color:0xffffff});
  const blkM = new THREE.MeshBasicMaterial({color:0x111111});
  const blshM = new THREE.MeshBasicMaterial({color:0xff9999,transparent:true,opacity:0.3});

  // HEAD
  const head = new THREE.Group();
  head.add(new THREE.Mesh(new THREE.SphereGeometry(0.42,20,16), skinM)); // face
  head.children[0].scale.set(1,1.08,0.9);
  const hb = new THREE.Mesh(new THREE.SphereGeometry(0.48,14,10), hairM);
  hb.position.z=-0.06; hb.scale.set(1.08,1.12,1.08); head.add(hb);

  // Per-waifu hair
  if(waifuId==='sakura'){
    const lh=new THREE.Mesh(new THREE.BoxGeometry(0.82,1.2,0.12),hairM); lh.position.set(0,-0.5,-0.22); head.add(lh);
    for(let i=-2;i<=2;i++){const b=new THREE.Mesh(new THREE.BoxGeometry(0.13,0.22,0.05),hairM);b.position.set(i*0.11,0.26,0.36);b.rotation.z=i*0.08;head.add(b);}
    const fl=new THREE.Mesh(new THREE.SphereGeometry(0.07,8,6),new THREE.MeshBasicMaterial({color:0xff69b4}));fl.position.set(0.35,0.18,0.08);head.add(fl);
  } else if(waifuId==='luna'){
    [-1,1].forEach(s=>{const t=new THREE.Mesh(new THREE.CylinderGeometry(0.1,0.05,0.8,6),hairM);t.position.set(s*0.42,-0.25,-0.08);t.rotation.z=s*0.35;head.add(t);});
    const sb=new THREE.Mesh(new THREE.BoxGeometry(0.18,0.32,0.05),hairM);sb.position.set(-0.28,0.12,0.32);sb.rotation.z=0.25;head.add(sb);
    const brim=new THREE.Mesh(new THREE.CylinderGeometry(0.38,0.38,0.04,8),new THREE.MeshLambertMaterial({color:0x2d1b69}));brim.position.y=0.46;head.add(brim);
    const hat=new THREE.Mesh(new THREE.ConeGeometry(0.22,0.48,8),new THREE.MeshLambertMaterial({color:0x2d1b69}));hat.position.y=0.72;hat.rotation.z=0.15;head.add(hat);
  } else if(waifuId==='coral'){
    for(let i=0;i<6;i++){const st=new THREE.Mesh(new THREE.CylinderGeometry(0.07,0.04,0.45+Math.random()*0.3,5),hairM);
      const a=(i/6)*Math.PI*2;st.position.set(Math.cos(a)*0.33,-0.2,Math.sin(a)*0.18-0.08);st.rotation.x=Math.sin(a)*0.3;st.rotation.z=Math.cos(a)*0.2;head.add(st);}
    const sh=new THREE.Mesh(new THREE.DodecahedronGeometry(0.07),new THREE.MeshLambertMaterial({color:0xff69b4}));sh.position.set(-0.36,0.12,0.04);head.add(sh);
  } else if(waifuId==='ember'){
    for(let i=0;i<7;i++){const sp=new THREE.Mesh(new THREE.ConeGeometry(0.06,0.22,4),hairM);
      const a=(i/7)*Math.PI*2;sp.position.set(Math.cos(a)*0.3,0.32,Math.sin(a)*0.28);sp.rotation.x=Math.sin(a)*0.5;sp.rotation.z=Math.cos(a)*0.5;head.add(sp);}
    const pt=new THREE.Mesh(new THREE.CylinderGeometry(0.07,0.03,0.55,5),hairM);pt.position.set(0,-0.15,-0.32);pt.rotation.x=0.5;head.add(pt);
    const bd=new THREE.Mesh(new THREE.TorusGeometry(0.34,0.025,4,12),new THREE.MeshLambertMaterial({color:0xcc0000}));bd.position.y=0.26;bd.rotation.x=Math.PI/2;head.add(bd);
  } else if(waifuId==='yuki'){
    const lh=new THREE.Mesh(new THREE.BoxGeometry(0.84,1.35,0.1),hairM);lh.position.set(0,-0.58,-0.18);head.add(lh);
    const bn=new THREE.Mesh(new THREE.BoxGeometry(0.62,0.14,0.05),hairM);bn.position.set(0,0.28,0.37);head.add(bn);
    const cr=new THREE.Mesh(new THREE.OctahedronGeometry(0.07),new THREE.MeshBasicMaterial({color:0xaaddff,transparent:true,opacity:0.8}));cr.position.set(0.32,0.22,0.08);head.add(cr);
  }

  // Eyes
  const eyeParts={w:[],i:[],p:[],h:[]};
  [-1,1].forEach(s=>{
    const ew=new THREE.Mesh(new THREE.SphereGeometry(0.1,12,10),whtM);ew.position.set(s*0.15,0.03,0.33);ew.scale.set(1,1.2,0.8);head.add(ew);eyeParts.w.push(ew);
    const ir=new THREE.Mesh(new THREE.SphereGeometry(0.07,12,10),eyeM);ir.position.set(s*0.15,0.02,0.37);head.add(ir);eyeParts.i.push(ir);
    const pu=new THREE.Mesh(new THREE.SphereGeometry(0.035,8,8),blkM);pu.position.set(s*0.15,0.01,0.40);head.add(pu);eyeParts.p.push(pu);
    const hl=new THREE.Mesh(new THREE.SphereGeometry(0.022,6,6),whtM);hl.position.set(s*0.13,0.06,0.41);head.add(hl);eyeParts.h.push(hl);
    const hl2=new THREE.Mesh(new THREE.SphereGeometry(0.012,4,4),whtM);hl2.position.set(s*0.17,-0.01,0.41);head.add(hl2);
  });
  // Blush
  const blush=[];
  [-1,1].forEach(s=>{const b=new THREE.Mesh(new THREE.SphereGeometry(0.055,8,6),blshM);b.position.set(s*0.22,-0.06,0.3);b.scale.set(1.3,0.8,0.5);head.add(b);blush.push(b);});
  // Mouth
  const mouth=new THREE.Mesh(new THREE.TorusGeometry(0.032,0.007,8,12,Math.PI),new THREE.MeshBasicMaterial({color:0xcc5566}));
  mouth.position.set(0,-0.12,0.36);mouth.rotation.x=Math.PI*0.15;head.add(mouth);
  head.position.y=1.85; root.add(head);

  // BODY
  const neck=new THREE.Mesh(new THREE.CylinderGeometry(0.07,0.09,0.14,6),skinM);neck.position.y=1.55;root.add(neck);
  const torso=new THREE.Mesh(new THREE.CylinderGeometry(0.19,0.16,0.52,8),outM);torso.position.y=1.22;root.add(torso);
  const collar=new THREE.Mesh(new THREE.TorusGeometry(0.19,0.025,4,12),new THREE.MeshLambertMaterial({color:w.color}));collar.position.y=1.46;collar.rotation.x=Math.PI/2;root.add(collar);
  const skirt=new THREE.Mesh(new THREE.ConeGeometry(0.34,0.42,10),new THREE.MeshLambertMaterial({color:new THREE.Color(w.outfit).multiplyScalar(0.85)}));skirt.position.y=0.74;skirt.rotation.x=Math.PI;root.add(skirt);
  // Arms
  const arms=[];
  [-1,1].forEach(s=>{const ag=new THREE.Group();
    ag.add(_p(new THREE.Mesh(new THREE.CylinderGeometry(0.04,0.035,0.32,6),outM),0,-0.14,0));
    ag.add(_p(new THREE.Mesh(new THREE.CylinderGeometry(0.035,0.03,0.28,6),skinM),0,-0.36,0));
    ag.add(_p(new THREE.Mesh(new THREE.SphereGeometry(0.035,6,6),skinM),0,-0.5,0));
    ag.position.set(s*0.25,1.35,0);ag.rotation.z=s*0.15;root.add(ag);arms.push(ag);});
  // Legs
  [-1,1].forEach(s=>{const lg=new THREE.Group();
    lg.add(_p(new THREE.Mesh(new THREE.CylinderGeometry(0.05,0.045,0.32,6),skinM),0,-0.14,0));
    lg.add(_p(new THREE.Mesh(new THREE.CylinderGeometry(0.045,0.055,0.22,6),new THREE.MeshLambertMaterial({color:new THREE.Color(w.outfit).multiplyScalar(0.7)})),0,-0.38,0));
    lg.position.set(s*0.1,0.52,0);root.add(lg);});

  let talking=false,talkT=0;
  return {
    root, head,
    update(dt){
      const t=performance.now()*0.001;
      root.position.y=Math.sin(t*2)*0.025;
      head.rotation.z=Math.sin(t*1.3)*0.04;head.rotation.y=Math.sin(t*0.7)*0.08;
      arms[0].rotation.z=0.15+Math.sin(t*1.8)*0.05;arms[1].rotation.z=-0.15+Math.sin(t*1.8+1)*0.05;
      const bk=t%3.5;const isB=bk>3.3;
      eyeParts.w.forEach(e=>e.scale.y=isB?0.1:1.2);eyeParts.i.forEach(e=>e.scale.y=isB?0.1:1);
      eyeParts.p.forEach(e=>e.visible=!isB);eyeParts.h.forEach(e=>e.visible=!isB);
      if(talking){talkT+=dt;mouth.scale.y=1+Math.sin(talkT*15)*0.6;head.rotation.x=Math.sin(talkT*3)*0.03;}
      else{mouth.scale.y=1;}
    },
    setTalking(v){talking=v;if(!v)talkT=0;},
    setExpr(e){blush.forEach(b=>b.visible=['blush','love','shy','happy','hopeful','cry_happy'].includes(e));},
    dispose(){root.traverse(c=>{if(c.geometry)c.geometry.dispose();if(c.material)c.material.dispose();});}
  };
}

// PLAYER MODEL
function createPlayerModel(){
  const g=new THREE.Group();
  g.add(_p(new THREE.Mesh(new THREE.CylinderGeometry(0.14,0.11,0.48,6),new THREE.MeshLambertMaterial({color:0x3366cc})),0,0.48,0));
  g.add(_p(new THREE.Mesh(new THREE.SphereGeometry(0.17,12,8),new THREE.MeshLambertMaterial({color:0xfde8d0})),0,0.88,0));
  g.add(_p(new THREE.Mesh(new THREE.SphereGeometry(0.19,8,6),new THREE.MeshLambertMaterial({color:0x3344aa,flatShading:true})),0,0.94,-0.03));
  // Eyes
  [-1,1].forEach(s=>{
    g.add(_p(new THREE.Mesh(new THREE.SphereGeometry(0.03,6,6),new THREE.MeshBasicMaterial({color:0x2244aa})),s*0.06,0.87,0.14));
    g.add(_p(new THREE.Mesh(new THREE.SphereGeometry(0.015,4,4),new THREE.MeshBasicMaterial({color:0xffffff})),s*0.05,0.89,0.15));
  });
  // Scarf
  const sc=new THREE.Mesh(new THREE.TorusGeometry(0.14,0.03,4,8),new THREE.MeshLambertMaterial({color:0xff6644}));
  sc.position.set(0,0.72,0);sc.rotation.set(Math.PI/2,0,0);g.add(sc);
  // Legs
  [-1,1].forEach(s=>g.add(_p(new THREE.Mesh(new THREE.CylinderGeometry(0.04,0.05,0.24,5),new THREE.MeshLambertMaterial({color:0x2255aa})),s*0.07,0.12,0)));
  return g;
}

