function mkDeco(type, params) {
  const g = new THREE.Group();
  if(type==='palm'){
    g.add(_p(new THREE.Mesh(new THREE.CylinderGeometry(0.12,0.18,3,6),new THREE.MeshLambertMaterial({color:0x8b6914})),0,1.5,0));
    for(let i=0;i<5;i++){const l=new THREE.Mesh(new THREE.ConeGeometry(0.25,1.3,4),new THREE.MeshLambertMaterial({color:0x228b22}));l.position.y=3;l.rotation.x=0.5+Math.random()*0.3;l.rotation.y=(i/5)*Math.PI*2;g.add(l);}
  } else if(type==='cherry'){
    g.add(_p(new THREE.Mesh(new THREE.CylinderGeometry(0.08,0.12,2,5),new THREE.MeshLambertMaterial({color:0x8b6914})),0,1,0));
    g.add(_p(new THREE.Mesh(new THREE.SphereGeometry(0.9,8,6),new THREE.MeshLambertMaterial({color:0xff69b4,flatShading:true})),0,2.4,0));
  } else if(type==='rock'){
    const r=new THREE.Mesh(new THREE.DodecahedronGeometry(0.4+Math.random()*0.3),new THREE.MeshLambertMaterial({color:params?.c||0x888888,flatShading:true}));r.position.y=0.3;r.rotation.set(Math.random(),Math.random(),0);g.add(r);
  } else if(type==='torii'){
    const tm=new THREE.MeshLambertMaterial({color:0xcc0000});
    [-1,1].forEach(s=>g.add(_p(new THREE.Mesh(new THREE.CylinderGeometry(0.06,0.08,2.8,6),tm),s*0.9,1.4,0)));
    g.add(_p(new THREE.Mesh(new THREE.BoxGeometry(2.5,0.12,0.12),tm),0,2.7,0));
    g.add(_p(new THREE.Mesh(new THREE.BoxGeometry(2.1,0.08,0.08),tm),0,2.35,0));
  } else if(type==='lantern'){
    g.add(_p(new THREE.Mesh(new THREE.CylinderGeometry(0.025,0.025,1.3,4),new THREE.MeshLambertMaterial({color:0x333333})),0,0.65,0));
    g.add(_p(new THREE.Mesh(new THREE.BoxGeometry(0.18,0.22,0.18),new THREE.MeshBasicMaterial({color:0xffcc00})),0,1.4,0));
    const pl=new THREE.PointLight(0xffcc00,0.5,5);pl.position.y=1.4;g.add(pl);
  } else if(type==='tower_struct'){
    g.add(_p(new THREE.Mesh(new THREE.CylinderGeometry(1,1.2,6,8),new THREE.MeshLambertMaterial({color:0x4a148c,flatShading:true})),0,3,0));
    g.add(_p(new THREE.Mesh(new THREE.ConeGeometry(1.6,2.5,8),new THREE.MeshLambertMaterial({color:0x6a1b9a,flatShading:true})),0,7,0));
  } else if(type==='bookshelf'){
    g.add(_p(new THREE.Mesh(new THREE.BoxGeometry(0.8,1.3,0.25),new THREE.MeshLambertMaterial({color:0x5c3a1e})),0,0.65,0));
    for(let i=0;i<4;i++){const b=new THREE.Mesh(new THREE.BoxGeometry(0.08,0.15,0.18),new THREE.MeshLambertMaterial({color:[0xcc0000,0x0044cc,0x006600,0x884400][i]}));b.position.set(-0.2+i*0.13,0.8,0.05);g.add(b);}
  } else if(type==='crystal_deco'){
    const c=new THREE.Mesh(new THREE.OctahedronGeometry(0.35+Math.random()*0.25),new THREE.MeshPhongMaterial({color:params?.c||0x88ccff,transparent:true,opacity:0.65,shininess:100}));c.position.y=0.5;g.add(c);
  } else if(type==='lava_rock'){
    g.add(_p(new THREE.Mesh(new THREE.DodecahedronGeometry(0.5),new THREE.MeshLambertMaterial({color:0x3d2b1f,flatShading:true})),0,0.3,0));
    g.add(_p(new THREE.Mesh(new THREE.SphereGeometry(0.18),new THREE.MeshBasicMaterial({color:0xff4400,transparent:true,opacity:0.5})),0,0.6,0));
  } else if(type==='lava_stream'){
    const lv=new THREE.Mesh(new THREE.PlaneGeometry(1,6),new THREE.MeshBasicMaterial({color:0xff4400,transparent:true,opacity:0.6}));lv.rotation.x=-Math.PI/2;lv.position.y=0.02;g.add(lv);
  } else if(type==='ice_pillar'){
    const h=1.5+Math.random()*1.5;
    g.add(_p(new THREE.Mesh(new THREE.CylinderGeometry(0.15,0.25,h,6),new THREE.MeshPhongMaterial({color:0xaaddff,transparent:true,opacity:0.55,shininess:100})),0,h/2,0));
  }
  return g;
}

function createAreaWorld(container, locKey, waifuId, cbs) {
  const ad = AREA_DEFS[locKey]; if(!ad) return null;
  const scene = new THREE.Scene();
  scene.background = new THREE.Color(ad.sky);
  scene.fog = new THREE.FogExp2(ad.sky, ad.fog);
  const W=container.clientWidth, H=container.clientHeight;
  const camera = new THREE.PerspectiveCamera(55,W/H,0.1,200);
  const renderer = new THREE.WebGLRenderer({antialias:true});
  renderer.setSize(W,H); renderer.setPixelRatio(Math.min(window.devicePixelRatio,2));
  renderer.shadowMap.enabled=true; container.appendChild(renderer.domElement);

  // Lighting
  scene.add(new THREE.AmbientLight(0xffeedd,locKey==='tower'||locKey==='cave'?0.4:0.6));
  const sun=new THREE.DirectionalLight(locKey==='volcano'?0xff8844:0xffffff,locKey==='tower'||locKey==='cave'?0.5:0.9);
  sun.position.set(10,20,8);sun.castShadow=true;scene.add(sun);
  if(locKey==='volcano'){const lava=new THREE.PointLight(0xff4400,0.8,20);lava.position.set(0,1,0);scene.add(lava);}
  if(locKey==='cave'){const ice=new THREE.PointLight(0x88ddff,0.5,15);ice.position.set(0,3,0);scene.add(ice);}

  // Ground
  const gnd=new THREE.Mesh(new THREE.PlaneGeometry(50,50,1,1),new THREE.MeshLambertMaterial({color:ad.ground}));
  gnd.rotation.x=-Math.PI/2;gnd.receiveShadow=true;scene.add(gnd);
  // Water for beach
  if(locKey==='beach'){const w=new THREE.Mesh(new THREE.PlaneGeometry(50,25),new THREE.MeshPhongMaterial({color:0x0077be,transparent:true,opacity:0.75,shininess:100}));w.rotation.x=-Math.PI/2;w.position.set(0,-0.1,18);scene.add(w);}
  // Boundary markers
  const BOUNDS=16;

  // Decorations
  ad.deco.forEach(d=>{const obj=mkDeco(d.t,d);if(obj){obj.position.set(d.x,0,d.z);scene.add(obj);}});

  // Quest items
  const qItems=[],collected=new Set();
  ad.items.forEach((qi,idx)=>{
    const g=new THREE.Group();
    const m=new THREE.Mesh(new THREE.OctahedronGeometry(0.18),new THREE.MeshBasicMaterial({color:ad.questColor}));
    g.add(m);
    const ring=new THREE.Mesh(new THREE.TorusGeometry(0.3,0.015,6,16),new THREE.MeshBasicMaterial({color:ad.questColor,transparent:true,opacity:0.4}));
    ring.rotation.x=Math.PI/2;g.add(ring);
    const glow=new THREE.PointLight(ad.questColor,0.3,3);g.add(glow);
    g.position.set(qi.x,0.6,qi.z);g.userData={idx};scene.add(g);qItems.push(g);
  });

  // Waifu
  let waifuM=null;
  if(waifuId){
    waifuM=createWaifu3D(waifuId);
    waifuM.root.position.set(ad.wp.x,0,ad.wp.z);
    waifuM.root.scale.setScalar(1.1);
    scene.add(waifuM.root);
  }

  // Player
  const player=createPlayerModel();
  player.position.set(ad.pp.x,0,ad.pp.z);
  scene.add(player);

  // Particles
  if(locKey==='temple'||locKey==='cave'){
    const pc=60,pg=new THREE.BufferGeometry(),pp=new Float32Array(pc*3),pcol=new Float32Array(pc*3);
    for(let i=0;i<pc;i++){pp[i*3]=(Math.random()-.5)*30;pp[i*3+1]=Math.random()*8+1;pp[i*3+2]=(Math.random()-.5)*30;
      if(locKey==='temple'){pcol[i*3]=1;pcol[i*3+1]=0.7;pcol[i*3+2]=0.8;}
      else{pcol[i*3]=0.7;pcol[i*3+1]=0.9;pcol[i*3+2]=1;}}
    pg.setAttribute('position',new THREE.BufferAttribute(pp,3));pg.setAttribute('color',new THREE.BufferAttribute(pcol,3));
    scene.add(new THREE.Points(pg,new THREE.PointsMaterial({size:0.2,vertexColors:true,transparent:true,opacity:0.6})));
  }

  // Input
  const keys={};let paused=false;
  const kd=e=>{keys[e.key.toLowerCase()]=true;if(e.key.toLowerCase()==='e'||e.key===' ')cbs.onInteract?.();};
  const ku=e=>keys[e.key.toLowerCase()]=false;
  window.addEventListener('keydown',kd);window.addEventListener('keyup',ku);

  // Touch controls
  let touchDir={x:0,z:0};
  const cv=renderer.domElement;
  cv.addEventListener('touchstart',e=>{e.preventDefault();const t=e.touches[0];const cx=cv.clientWidth/2,cy=cv.clientHeight/2;
    touchDir={x:(t.clientX-cx)/cx,z:(t.clientY-cy)/cy};},{passive:false});
  cv.addEventListener('touchmove',e=>{e.preventDefault();const t=e.touches[0];const cx=cv.clientWidth/2,cy=cv.clientHeight/2;
    touchDir={x:(t.clientX-cx)/cx,z:(t.clientY-cy)/cy};},{passive:false});
  cv.addEventListener('touchend',()=>{touchDir={x:0,z:0};cbs.onInteract?.();});

  let fid,nearW=false;
  const clk=new THREE.Clock();
  function animate(){
    fid=requestAnimationFrame(animate);
    const dt=Math.min(clk.getDelta(),0.05),t=clk.elapsedTime;
    if(!paused){
      const spd=5*dt;
      let dx=0,dz=0;
      if(keys['w']||keys['arrowup'])dz-=spd;if(keys['s']||keys['arrowdown'])dz+=spd;
      if(keys['a']||keys['arrowleft'])dx-=spd;if(keys['d']||keys['arrowright'])dx+=spd;
      dx+=touchDir.x*spd*1.5;dz+=touchDir.z*spd*1.5;
      if(dx||dz){
        player.position.x=Math.max(-BOUNDS,Math.min(BOUNDS,player.position.x+dx));
        player.position.z=Math.max(-BOUNDS,Math.min(BOUNDS,player.position.z+dz));
        player.rotation.y=Math.atan2(dx,dz);
        // Bobbing walk
        player.position.y=Math.abs(Math.sin(t*10))*0.05;
      } else { player.position.y=0; }
    }
    // Camera
    camera.position.set(player.position.x,5.5,player.position.z+7);
    camera.lookAt(player.position.x,1.2,player.position.z);
    // Waifu
    if(waifuM){
      waifuM.update(dt);
      const dx2=player.position.x-waifuM.root.position.x,dz2=player.position.z-waifuM.root.position.z;
      waifuM.root.rotation.y=Math.atan2(dx2,dz2);
      const dist=Math.sqrt(dx2*dx2+dz2*dz2);
      if(dist<2.2&&!nearW){nearW=true;cbs.onNearWaifu?.();}
      else if(dist>=2.2&&nearW){nearW=false;cbs.onLeaveWaifu?.();}
    }
    // Quest items
    qItems.forEach((item,idx)=>{
      if(collected.has(idx))return;
      item.rotation.y=t*2+idx;item.children[0].position.y=Math.sin(t*3+idx)*0.1;
      const dx3=player.position.x-item.position.x,dz3=player.position.z-item.position.z;
      if(Math.sqrt(dx3*dx3+dz3*dz3)<1.5){collected.add(idx);scene.remove(item);cbs.onCollect?.(idx,collected.size);}
    });
    renderer.render(scene,camera);
  }
  animate();
  const onR=()=>{camera.aspect=container.clientWidth/container.clientHeight;camera.updateProjectionMatrix();renderer.setSize(container.clientWidth,container.clientHeight);};
  window.addEventListener('resize',onR);
  return {
    dispose(){cancelAnimationFrame(fid);window.removeEventListener('resize',onR);window.removeEventListener('keydown',kd);window.removeEventListener('keyup',ku);renderer.dispose();if(container.contains(cv))container.removeChild(cv);if(waifuM)waifuM.dispose();},
    collected(){return collected.size;},
    total(){return ad.questCount;},
    questName(){return ad.questName;},
    pause(){paused=true;},
    resume(){paused=false;},
    setWaifuTalk(v){waifuM?.setTalking(v);},
    setWaifuExpr(e){waifuM?.setExpr(e);}
  };
}
